import Table from "../components/Table";

function Home({ header, contacts, editContact, deleteContact }) {
  return (
    <Table
      tableHeader={header}
      contacts={contacts}
      onEdit={editContact}
      onDelete={deleteContact}
    />
  );
}

export default Home;
